        <div className="header">
            <nav class="row navbar navbar-expand-sm bg-light justify-content-center haha">
                <div className="row">
                    <div className="col-4">thu hoa</div>
                    <div className="col-4">thu hoa</div>
                    <div className="col-4">thu hoa</div>

                </div>
                
            </nav>
        </div>
    )
}
